import React from 'react';
import { StyledHeader } from './styled/Header.styled';

const Header = () => {
    return (
        <>
            <StyledHeader bg={'red'}>
                <h1>Header</h1>
            </StyledHeader>
            <StyledHeader bg={'blue'}>
                <h1>Header</h1>
            </StyledHeader>
        </>
    );
};

export default Header;
